      price: 16.5,
    },
    {
      id: 'm3',
      name: 'Barbecue Burger',
      description: 'American, raw, meaty',
      price: 12.99,
    },
    {
      id: 'm4',
      name: 'Green Bowl',
      description: 'Healthy...and green...',
      price: 18.99,
    },
  ];



  const AvailableMeal=(props)=>{

const mealList=DUMMY_MEALS.map((item)=><MealItem id={item.id} name={item.name} description={item.description} price={item.price}/>)

return(<section className={classes.meals}>
    <Card><ul>{mealList}</ul>
</Card>
</section>
)

  }




  export default AvailableMeal;
